(118, 1, '2015-07-12 13:39:20', '2015-07-12 12:39:20', '<h2>Support</h2>\nProvided for member data upload and real-time transaction message processing. Highly secure and resilient, PCI Compliant, ISO 27001 certified data centre, accredited to IL3 /IL4, ISO 9001 and 14001 certified, PGA accredited and official classified services using encrypted PSN accredited overlay. <sup>[15]</sup>\n<h2 id="post-87">Data Breach Horizon Scan</h2>\n<div class="post-content">\n\nMembers will be alerted of latest data breaches and new types of threats as they are discovered.\n\nThe number of records that were reported stolen by criminals has grown from 96m in 2010 to over 1bn in 2014 with 84% of the breaches coming from outside the organisation and the number of incidents of payment card information theft growing at 20% per annum.[13]\n\nVirtual fraud factories have been created to turn this data into cash. As more individuals move to m-commerce then more data will be stored in new systems or in connected smartphones.[14]\n\nExisting detection systems will find it increasingly difficult to keep pace with these sophisticated attacks as they have been designed for the previous decadeâs fraud types, where the emphasis is only on detection at the point of the transaction using siloed data.\n<h1 id="post-89">Intellectual Property Portfolio</h1>\n<div class="post-content">\n\nMembers will enjoy complete access to all FITS IP at no additional cost.\n\nThe University of Surrey has a long and successful track record in patenting and commercially exploiting the results of its research programmes.\n\nOver the last five years, 22 patents have been filed in the physical sciences some of which would be highly relevant to the interests of the FITS members.\n\nIn addition to providing a physical hub, FITS will deliver a formal structure to ensure that innovative intellectual property arising from collaborative research can be captured and protected.\n\n</div>\n</div>\n<h2>Secure Private Cloud</h2>\nA support service for all members including Fathom based on the FITS standard SLA (with additional cost options for 24x7, 365 support both online and telephone within defined SLA times).\n<h2>Insights</h2>\nPractical best practice guidelines in the implementation of prevention measures and the detection of fraud. Including the full customer life-cycle from application to collections using what is commercially available today as elements of an overall solution.\n<h2>Best Practice Guidelines</h2>\nQuarterly newsletter including analytical analysis of fraud behaviours and patterns both in general and detail along with advice, rules and methods to prevent or detect.\n<h2>Open-Source Library &amp; Tools</h2>\nCode is written and developed at FITS based on the Fraud Laboratory research and is provided to work with R and other APIs. To be available to the Vendor Club for their use/integration into solutions.\n<h2>Annual Conference</h2>\nNetworking opportunities with your colleagues along with invited government, law enforcement and vendors.', 'Member Benefits', '', 'inherit', 'open', 'open', '', '73-autosave-v1', '', '', '2015-07-12 13:39:20', '2015-07-12 12:39:20', '', 73, 'http://localhost:8888/fits/73-autosave-v1/', 0, 'revision', '', 0),
(119, 1, '2015-07-09 11:09:39', '2015-07-09 10:09:39', '<h2>Support</h2>\r\nProvided for member data upload and real-time transaction message processing. Highly secure and resilient, PCI Compliant, ISO 27001 certified data centre, accredited to IL3 /IL4, ISO 9001 and 14001 certified, PGA accredited and official classified services using encrypted PSN accredited overlay. <sup>[15]<sup>\r\n<h2>Secure Private Cloud</h2>\r\nA support service for all members including Fathom based on the FITS standard SLA (with additional cost options for 24x7, 365 support both online and telephone within defined SLA times).\r\n<h2>Insights</h2>\r\nPractical best practice guidelines in the implementation of prevention measures and the detection of fraud. Including the full customer life-cycle from application to collections using what is commercially available today as elements of an overall solution.\r\n<h2>Best Practice Guidelines</h2>\r\nQuarterly newsletter including analytical analysis of fraud behaviours and patterns both in general and detail along with advice, rules and methods to prevent or detect.\r\n<h2>Open-Source Library &amp; Tools</h2>\r\nCode is written and developed at FITS based on the Fraud Laboratory research and is provided to work with R and other APIs. To be available to the Vendor Club for their use/integration into solutions.\r\n<h2>Annual Conference</h2>\r\nNetworking opportunities with your colleagues along with invited government, law enforcement and vendors.', 'Member Benefits', '', 'inherit', 'open', 'open', '', '73-revision-v1', '', '', '2015-07-09 11:09:39', '2015-07-09 10:09:39', '', 73, 'http://localhost:8888/fits/73-revision-v1/', 0, 'revision', '', 0),
(127, 1, '2015-07-09 11:29:36', '2015-07-09 10:29:36', '<p>The MindsI Engine is an adaptive machine learning system available within Fathom. The MindsI Engine has been designed to learn from the billions of records that you are collecting every day and to provide you answers.</p>\r\n\r\n<p>The MindsI Engine requires just one step to setup and it will never get out of date as starts learning straightaway â thatâs really important. No project is required, no batch learning, no weeks of time and resource and no paying vendors. It just starts doing its job as soon as soon as it is activated. The MindsI engine educes the need for expensive and time-consuming manual processes and the reliance on scarce analysts and experts.</p>\r\n<h2>Making Decisions - 24x7, 365 days a year</h2>\r\n<p>The MindsI Engine will listen to your data quietly in the background, 24x7, 365 days a year; helping to automate fraud decisions. This allows your experts to focus on just those decisions where human knowledge is needed.</p>\r\n\r\n<p>MindsI can be combined with our Storm Rules Engine to make fully automated decisions perhaps sending a text message or email to a customer. Of course all this happens in real-time.Â We think this is going to disrupt the way you think.</p>\r\n<h2>Get the right answers - fast</h2>\r\n<p>The uptake and use of neural networks and machine learning has been hampered by their âblack boxâ nature; while they may give an answer we need to know why. All too often machine learning keeps the exact method of reaching a decision hidden and you are reliant on experts or consultants to set them up.</p>\r\n\r\n<p>Using our patented technology (US 20110264612) knowledge is extracted from the MindsI Engine in the form of easy to understand English like rules. Understanding the underlying decision structure allows you to quickly determine Key Performance Indicators (KPI) in your business and because MindsI is always learning â you can see how these KPIâs are changing over time. We think that is amazing!</p>\r\n<h2>Out with the old</h2>\r\n<p>In a typical machine learning system, you will have to undertake a project:</p>\r\n<ol>\r\n	<li>Choose and collect data</li>\r\n	<li>Review and clean the data</li>\r\n	<li>Convert the data into a suitable format</li>\r\n	<li>Build models</li>\r\n	<li>Evaluate models</li>\r\n	<li>And finally deploy the chosen model.</li>\r\n</ol>\r\n<p>This process takes both time and expertise; how quickly will the fixed model get out of date? The MindsI Engine requires just one step and will never get out of date:\r\n<h2>Setup and start</h2>\r\nThe MindsI Engine starts learning as soon as it is activated. The engine can process almost any type of input field:\r\n<ul>\r\n	<li>Continuous values â e.g. value of a transaction, time at address, age</li>\r\n	<li>Discreet values â e.g. product codes, transaction type, country codes, region codes</li>\r\n	<li>Dates and Times</li>\r\n	<li>Unstructured data â e.g. emails, documents, voice-to-text</li>\r\n</ul>\r\n<p>Just as the biological brain consists of a set of specialised structures for different types of inputs, such as vision, auditory, olfactory, so too does the MindsI Engine. Fields are automatically processed without fuss or time consuming human analysis.</p>\r\n<h2>Knowledge</h2>\r\n<p>MindsI needs to have sufficient experience of your data before it becomes sufficiently confident to start making decisions. The more examples it sees the more confident it will become and the more accurate. It is not just the volume of data but also how rich it is. MindsI constantly reviews its data feeds to ensure there is sufficient âintrinsic dimensionalityâ to enable an accurate output. MindsI has been created to only make decisions based on a solid foundation of learning â donât ask MindsI to predict the outcome of a Formula 1 race based on just two examples or the price of Apple shares (AAPL) to within a fraction of cent in 90-days time (although we are working on this!).</p>\r\n\r\n<p>We know that it is easy for models to make a decision â the trick is to maintain a high accuracy and reduce the number of incorrect decisions. These false-positives can clog automated fraud decision systems and can give them a bad reputation with their users and reviewers. A range of tools are provided to balance accuracy, false-positives (an âacceptâ when it should have been âreferâ) and false-negatives (a âdeclineâ when it should have been âacceptâ). Of course we do not expect you to work all this out â the MindsI Engine uses a novel Peareto Front Multi-Objective Evolutionary algorithm to sort it all out.</p>', 'The MindsI Engine', '', 'publish', 'open', 'open', '', 'the-mindsi-engine', '', '', '2015-08-03 12:03:14', '2015-08-03 11:03:14', '', 79, 'http://localhost:8888/fits/?page_id=127', 0, 'page', '', 0);
