(177, 1, '2015-07-11 23:51:42', '2015-07-11 22:51:42', '<h1>Become a Member</h1>\r\nWe are delighted that you are interested in joining FITS as a member. Membership is only available to registered banking and financial industry businesses and to consultants and vendors working in the payments industry. To uphold the highest professional and security standards there is a membership application process and you will need to be sponsored by a current member or by a FITS team member. Membership will then be by invitation.\r\n\r\nWe are currently seeking the FITS-5 to be our cornerstone members. These members will help shape FITS into an industry leading body whose aims align with their objectives. We need Tier 1 businesses that take an active interest in cutting their fraud write-offs and operational costs and in reducing fraud crime. Our FITS-5 members have a range of additional benefits, including the option to take a stake in the FITS corporate entity as it is formed.\r\n<h3>How much?</h3>\r\nThere are fixed annual membership fees that include the full range of benefits, including the Fathom fraud management software and support.\r\n\r\nThe current annual membership fee is Â£385 (UK &amp; EU). There is an election fee of Â£220 but if you join for two years or more, you will receive a substantial discount on that fee.', 'Institute of Financial Innovation in Transactions & Security', '', 'inherit', 'open', 'open', '', '175-revision-v1', '', '', '2015-07-11 23:51:42', '2015-07-11 22:51:42', '', 175, 'http://localhost:8888/fits/175-revision-v1/', 0, 'revision', '', 0),
