(185, 1, '2015-07-12 13:37:38', '2015-07-12 12:37:38', 'We are establishing a FITS advisory board to help steer all aspects of the strategic direction of FITS. The advisory board is to be made up of members, payment industry experts, key figures from the research community, law enforcement, regulators, other industry bodies and government.\r\n\r\nOur Advisory Board is not yet another âthink tankâ but a group of individuals that share in our vision for reducing crime due to fraud and improving the security of all payments.Â  A quarterly, round-table Board meeting will be held and key topics discussed.\r\n\r\nThe Advisory Board will also oversee aspects of our governance to ensure an open and transparent operating environment.\r\n\r\nIf you are interested in joining the Advisory Board please contact our member services.', 'The Advisory Board', '', 'inherit', 'open', 'open', '', '71-revision-v1', '', '', '2015-07-12 13:37:38', '2015-07-12 12:37:38', '', 71, 'http://localhost:8888/fits/71-revision-v1/', 0, 'revision', '', 0),
(186, 1, '2015-07-12 13:41:13', '2015-07-12 12:41:13', '<h2>Support</h2>\r\n\r\nProvided for member data upload and real-time transaction message processing. Highly secure and resilient, PCI Compliant, ISO 27001 certified data centre, accredited to IL3 /IL4, ISO 9001 and 14001 certified, PGA accredited and official classified services using encrypted PSN accredited overlay. <sup>[15]</sup>\r\n\r\n<h2 id="post-87">Data Breach Horizon Scan</h2>\r\n\r\nMembers will be alerted of latest data breaches and new types of threats as they are discovered.\r\n\r\nThe number of records that were reported stolen by criminals has grown from 96m in 2010 to over 1bn in 2014 with 84% of the breaches coming from outside the organisation and the number of incidents of payment card information theft growing at 20% per annum.<sup>[13]</sup>\r\n\r\nVirtual fraud factories have been created to turn this data into cash. As more individuals move to m-commerce then more data will be stored in new systems or in connected smartphones.<sup>[14]</sup>\r\n\r\nExisting detection systems will find it increasingly difficult to keep pace with these sophisticated attacks as they have been designed for the previous decadeâs fraud types, where the emphasis is only on detection at the point of the transaction using siloed data.\r\n\r\n<h2>Intellectual Property Portfolio</h2>\r\n\r\nMembers will enjoy complete access to all FITS IP at no additional cost.\r\n\r\nThe University of Surrey has a long and successful track record in patenting and commercially exploiting the results of its research programmes.\r\n\r\nOver the last five years, 22 patents have been filed in the physical sciences some of which would be highly relevant to the interests of the FITS members.\r\n\r\nIn addition to providing a physical hub, FITS will deliver a formal structure to ensure that innovative intellectual property arising from collaborative research can be captured and protected.\r\n\r\n<h2>Secure Private Cloud</h2>\r\n\r\nA support service for all members including Fathom based on the FITS standard SLA (with additional cost options for 24x7, 365 support both online and telephone within defined SLA times).\r\n\r\n<h2>Insights</h2>\r\n\r\nPractical best practice guidelines in the implementation of prevention measures and the detection of fraud. Including the full customer life-cycle from application to collections using what is commercially available today as elements of an overall solution.\r\n\r\n<h2>Best Practice Guidelines</h2>\r\n\r\nQuarterly newsletter including analytical analysis of fraud behaviours and patterns both in general and detail along with advice, rules and methods to prevent or detect.\r\n\r\n<h2>Open-Source Library &amp; Tools</h2>\r\n\r\nCode is written and developed at FITS based on the Fraud Laboratory research and is provided to work with R and other APIs. To be available to the Vendor Club for their use/integration into solutions.\r\n\r\n<h2>Annual Conference</h2>\r\n\r\nNetworking opportunities with your colleagues along with invited government, law enforcement and vendors.', 'Member Benefits', '', 'inherit', 'open', 'open', '', '73-revision-v1', '', '', '2015-07-12 13:41:13', '2015-07-12 12:41:13', '', 73, 'http://localhost:8888/fits/73-revision-v1/', 0, 'revision', '', 0),
