(241, 1, '2015-07-29 17:00:30', '2015-07-29 16:00:30', '<p style="text-align: center;">We are establishing a FITS advisory board to help steer all aspects of the strategic direction of FITS. The advisory board is to be made up of members, payment industry experts, key figures from the research community, law enforcement, regulators, other industry bodies and government.</p>\r\n<p style="text-align: center;">Our Advisory Board is not yet another âthink tankâ but a group of individuals that share in our vision for reducing crime due to fraud and improving the security of all payments.Â  A quarterly, round-table Board meeting will be held and key topics discussed.</p>\r\n<p style="text-align: center;">The Advisory Board will also oversee aspects of our governance to ensure an open and transparent operating environment.</p>\r\n<p style="text-align: center;">If you are interested in joining the Advisory Board please contact our member services.</p>', 'The Advisory Board', '', 'inherit', 'open', 'open', '', '71-revision-v1', '', '', '2015-07-29 17:00:30', '2015-07-29 16:00:30', '', 71, 'http://localhost:8888/fits/71-revision-v1/', 0, 'revision', '', 0),
