(249, 1, '2015-07-30 17:18:59', '2015-07-30 16:18:59', 'FraXses is a federated big data application framework, enabling data to be employed by humans and machines not just analytics or business applications. FraXses shows business''s that it is possible to use data to make a valuable difference. The use of algorithms and innovative machine learning to process data more quickly, seamlessly obtaining powerful insights and answers where and when they are needed.\r\n<img class="size-large wp-image-413 aligncenter" src="http://localhost:8888/fits/wp-content/uploads/2015/07/fraXses-new-simplified_x1280-1024x372.png" alt="fraXses-new-simplified_x1280" width="1024" height="372" />\r\nSuspendisse nisl elit, rhoncus eget, elementum ac, condimentum eget, diam. Morbi mollis tellus ac sapien. Nam eget dui. Nam ipsum risus, rutrum vitae, vestibulum eu, molestie vel, lacus. In hac habitasse platea dictumst.\r\n\r\nPraesent ac massa at ligula laoreet iaculis. Donec vitae sapien ut libero venenatis faucibus. Ut a nisl id ante tempus hendrerit. Proin faucibus arcu quis ante. Donec pede justo, fringilla vel, aliquet nec, vulputate eget, arcu.\r\n\r\nDonec venenatis vulputate lorem. Mauris sollicitudin fermentum libero. Proin sapien ipsum, porta a, auctor quis, euismod ut, mi. Suspendisse non nisl sit amet velit hendrerit rutrum. In turpis.', 'FraXses', '', 'publish', 'closed', 'closed', '', 'fraxses', '', '', '2015-09-07 16:02:29', '2015-09-07 15:02:29', '', 0, 'http://localhost:8888/fits/?post_type=partners&#038;p=249', 0, 'partners', '', 0),
