(273, 1, '2015-07-31 06:35:47', '2015-07-31 05:35:47', '<div class="table" style="padding-left:20px;padding-right:20px;">\r\n<table class="table table-responsive table-hover">\r\n<tr>\r\n<td style="width:60px;text-align:center;color:#AE9B80;">â</td>\r\n<td>To focus on the participants and processes in the cashless payments sector.</td>\r\n</tr>\r\n<tr>\r\n<td style="width:60px;text-align:center;color:#AE9B80;">â</td>\r\n<td>To measurably reduce the value of fraud write-offs from cashless payments for our members.</td>\r\n</tr>\r\n<tr>\r\n<td style="width:60px;text-align:center;color:#AE9B80;">â</td>\r\n<td>To reduce the operational costs of the cashless payments fraud lifecycle by at least 50% for our members.</td>\r\n</tr>\r\n<tr>\r\n<td style="width:60px;text-align:center;color:#AE9B80;">â</td>\r\n<td>To dramatically cut the funding from cashless payment fraud into to criminal enterprise.</td>\r\n</tr>\r\n<tr>\r\n<td style="width:60px;text-align:center;color:#AE9B80;">â</td>\r\n<td>To undertake a focused programme of research into novel techniques and technology to have a substantial impact on current fraud approaches that is published and made available to all members.</td>\r\n</tr>\r\n<tr>\r\n<td style="width:60px;text-align:center;color:#AE9B80;">â</td>\r\n<td>To provide state of the art software fraud management platform to all members that can be deployed locally or in the FITS data cloud.</td>\r\n</tr>\r\n<tr>\r\n<td style="width:60px;text-align:center;color:#AE9B80;">â</td>\r\n<td>To provide a PCI approved, point-to-point secure cloud environment to enable high-level fraud analytics and data collaboration.</td>\r\n</tr>\r\n<tr>\r\n<td style="width:60px;text-align:center;color:#AE9B80;">â</td>\r\n<td>To collaborate and promote a co-operative environment with our members and all participants in payment processing.</td>\r\n</tr>\r\n<tr>\r\n<td style="width:60px;text-align:center;color:#AE9B80;">â</td>\r\n<td>To build and share knowledge in a secure environment and to provide a discussion forum for our members.</td>\r\n</tr>\r\n<tr>\r\n<td style="width:60px;text-align:center;color:#AE9B80;">â</td>\r\n<td>To form strategic alliances with industry, government and law enforcement bodies.</td>\r\n</tr>\r\n<tr>\r\n<td style="width:60px;text-align:center;color:#AE9B80;">â</td>\r\n<td>To establish working relationships with fraud forums worldwide.</td>\r\n</tr>\r\n<tr>\r\n<td style="width:60px;text-align:center;color:#AE9B80;">â</td>\r\n<td>To encourage payment processors worldwide to seek membership.</td>\r\n</tr>\r\n<tr>\r\n<td style="width:60px;text-align:center;color:#AE9B80;">â</td>\r\n<td>To promote high standards of ethics, excellence and professionalism throughout the payments industry and to represent the interests of our members to the wider business community and government.</td>\r\n</tr>\r\n<tr>\r\n<td style="width:60px;text-align:center;color:#AE9B80;">â</td>\r\n<td>To identify fraud risks, emerging fraud types and approaches for mitigation and to publish, disseminate or otherwise make available the results of such study or research.</td>\r\n</tr>\r\n<tr>\r\n<td style="width:60px;text-align:center;color:#AE9B80;">â</td>\r\n<td>To publically raise awareness of tools and methods to enable the payments industry to manage fraud more effectively.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style="text-align: center;"><small>This information is provisional. All products and services are subject to terms and conditions. FITS reserves the right to alter the benefits and services it offers at any time. All details are correct at time of going to press. Fathom is under development and makes use of licenced technology.</small></p>', 'Membership Aims', '', 'publish', 'open', 'open', '', 'membership-aims', '', '', '2015-08-25 12:26:56', '2015-08-25 11:26:56', '', 55, 'http://localhost:8888/fits/?page_id=273', 0, 'page', '', 0),
