(276, 1, '2015-08-03 10:51:50', '2015-08-03 09:51:50', '<ul>\r\n	<li>To focus on the participants and processes in the cashless payments sector</li>\r\n	<li>To measurably reduce the value of fraud write-offs from cashless payments for our members.</li>\r\n	<li>To reduce the operational costs of the cashless payments fraud lifecycle by at least 50% for our members.</li>\r\n	<li>To dramatically cut the funding from cashless payment fraud into to criminal enterprise.</li>\r\n	<li>To undertake a focused programme of research into novel techniques and technology to have a substantial impact on current fraud approaches that is published and made available to all members.</li>\r\n	<li>To provide a state of the art software fraud management platform to all members that can be deployed locally or in the FITS data cloud.</li>\r\n	<li>To provide a PCI approved, point-to-point secure cloud environment to enable high-level fraud analytics and data collaboration.</li>\r\n	<li>To collaborate and promote a co-operative environment with our members and all participants in payment processing.</li>\r\n	<li>To build and share knowledge in a secure environment and to provide a discussion forum for our members.</li>\r\n	<li>To form strategic alliances with industry, government and law enforcement bodies.</li>\r\n	<li>To establish working relationships with fraud forums worldwide.</li>\r\n	<li>To encourage payment processors worldwide to seek membership.</li>\r\n	<li>To promote high standards of ethics, excellence and professionalism throughout the payments industry and to represent the interests of our members to the wider business community and government.</li>\r\n	<li>To identify fraud risks, emerging fraud types and approaches for mitigation and to publish, disseminate or otherwise make available the results of such study or research.</li>\r\n	<li>To publically raise awareness of tools and methods to enable the payments industry to manage fraud more effectively.</li>\r\n</ul>\r\n&nbsp;\r\n\r\n<small>This information is provisional. All products and services are subject to terms and conditions. FITS reserves the right to alter the benefits and services it offers at any time. All details are correct at time of going to press. Fathom is under development and makes use of licenced technology.</small>', 'Membership Aims', '', 'inherit', 'open', 'open', '', '273-revision-v1', '', '', '2015-08-03 10:51:50', '2015-08-03 09:51:50', '', 273, 'http://localhost:8888/fits/273-revision-v1/', 0, 'revision', '', 0),
(277, 1, '2015-08-03 10:53:01', '2015-08-03 09:53:01', '<ul>\r\n	<li>To focus on the participants and processes in the cashless payments sector</li>\r\n	<li>To measurably reduce the value of fraud write-offs from cashless payments for our members.</li>\r\n	<li>To reduce the operational costs of the cashless payments fraud lifecycle by at least 50% for our members.</li>\r\n	<li>To dramatically cut the funding from cashless payment fraud into to criminal enterprise.</li>\r\n	<li>To undertake a focused programme of research into novel techniques and technology to have a substantial impact on current fraud approaches that is published and made available to all members.</li>\r\n	<li>To provide a state of the art software fraud management platform to all members that can be deployed locally or in the FITS data cloud.</li>\r\n	<li>To provide a PCI approved, point-to-point secure cloud environment to enable high-level fraud analytics and data collaboration.</li>\r\n	<li>To collaborate and promote a co-operative environment with our members and all participants in payment processing.</li>\r\n	<li>To build and share knowledge in a secure environment and to provide a discussion forum for our members.</li>\r\n	<li>To form strategic alliances with industry, government and law enforcement bodies.</li>\r\n	<li>To establish working relationships with fraud forums worldwide.</li>\r\n	<li>To encourage payment processors worldwide to seek membership.</li>\r\n	<li>To promote high standards of ethics, excellence and professionalism throughout the payments industry and to represent the interests of our members to the wider business community and government.</li>\r\n	<li>To identify fraud risks, emerging fraud types and approaches for mitigation and to publish, disseminate or otherwise make available the results of such study or research.</li>\r\n	<li>To publically raise awareness of tools and methods to enable the payments industry to manage fraud more effectively.</li>\r\n</ul>\r\n&nbsp;\r\n<p style="text-align: center;"><small>This information is provisional. All products and services are subject to terms and conditions. FITS reserves the right to alter the benefits and services it offers at any time. All details are correct at time of going to press. Fathom is under development and makes use of licenced technology.</small></p>', 'Membership Aims', '', 'inherit', 'open', 'open', '', '273-revision-v1', '', '', '2015-08-03 10:53:01', '2015-08-03 09:53:01', '', 273, 'http://localhost:8888/fits/273-revision-v1/', 0, 'revision', '', 0),
(278, 1, '2015-08-03 10:56:43', '2015-08-03 09:56:43', '<p style="text-align: left;">Did you know that every $1 in $100 of all crime proceeds in the world comes from payment card fraud according to the United Nations?</p>\n<br/>\n<p style="text-align: left;">Each $1 of fraud may help towards funding terrorist networks like the al-Qaeda for bombs and arms as well as organised crime gangs and illicit drugs. Thatâs a potential $16,000,000,000 of funding to criminals in 2015.</p>\n<br/>\n<p style="text-align: left;">If this was a single company it would be in the top 250 of all global companies and its shareholders would be happy at the 15% annual growth. But we are not happy.Â We want to stop this money going to criminals. We want to fight to dramatically cut fraud, reversing the growth and we want to do this with you.Â Fighting payment fraud is hard and expensive but it doesnât have to be. We are committed to a visionary program of research that also delivers what is needed right now.Â The Institute<sup>[tbc]</sup> for Financial Innovation in Transactions and Security (FITS) is an independent non-profit organisation with this simple vision: together we can disrupt criminals.</p>\n<br/>\n<p style="text-align: left;">As a member of FITS you will have access to an extensive range of benefits included in your annual member fees.Â This includes Fathom a powerful AI driven real-time fraud management system built on a big data engine with interactive analytics available on a secure private cloud or deployed in your data-centre.Â Created for all our members; generating knowledge on evolving fraud types through the latest Data Analytics breakthroughs.</p>\n<p style="text-align: left;">Having spent the last 25 years building innovative systems to spot fraud, one thing is strikingly obvious, the fraudsters and hackers donât care who they attack: cardholders, banks, issuers, acquirers, gateways, payment processors, merchants, big or small, from physical cards to large-scale data breaches. It is by bringing the best minds, the best technology and working together that we will make a measurable impact on fraud.</p>\n<p style="text-align: left;">FITS has been formed by a passionate team committed to this vision. We work with all our members towards our shared vision:</p>\n\n<blockquote>\n<p style="text-align: center;">"Together we can disrupt criminal payment fraud."</p>\n</blockquote>', 'Our Vision', '', 'inherit', 'open', 'open', '', '210-autosave-v1', '', '', '2015-08-03 10:56:43', '2015-08-03 09:56:43', '', 210, 'http://localhost:8888/fits/210-autosave-v1/', 0, 'revision', '', 0),
(279, 1, '2015-08-03 10:57:03', '2015-08-03 09:57:03', '<p style="text-align: left;">Did you know that every $1 in $100 of all crime proceeds in the world comes from payment card fraud according to the United Nations?</p>\r\n<br/>\r\n<p style="text-align: left;">Each $1 of fraud may help towards funding terrorist networks like the al-Qaeda for bombs and arms as well as organised crime gangs and illicit drugs. Thatâs a potential $16,000,000,000 of funding to criminals in 2015.</p>\r\n<br/>\r\n<p style="text-align: left;">If this was a single company it would be in the top 250 of all global companies and its shareholders would be happy at the 15% annual growth. But we are not happy.Â We want to stop this money going to criminals. We want to fight to dramatically cut fraud, reversing the growth and we want to do this with you.Â Fighting payment fraud is hard and expensive but it doesnât have to be. We are committed to a visionary program of research that also delivers what is needed right now.Â The Institute<sup>[tbc]</sup> for Financial Innovation in Transactions and Security (FITS) is an independent non-profit organisation with this simple vision: together we can disrupt criminals.</p>\r\n<br/>\r\n<p style="text-align: left;">As a member of FITS you will have access to an extensive range of benefits included in your annual member fees.Â This includes Fathom a powerful AI driven real-time fraud management system built on a big data engine with interactive analytics available on a secure private cloud or deployed in your data-centre.Â Created for all our members; generating knowledge on evolving fraud types through the latest Data Analytics breakthroughs.</p>\r\n<br/>\r\n<p style="text-align: left;">Having spent the last 25 years building innovative systems to spot fraud, one thing is strikingly obvious, the fraudsters and hackers donât care who they attack: cardholders, banks, issuers, acquirers, gateways, payment processors, merchants, big or small, from physical cards to large-scale data breaches. It is by bringing the best minds, the best technology and working together that we will make a measurable impact on fraud.</p>\r\n<br/>\r\n<p style="text-align: left;">FITS has been formed by a passionate team committed to this vision. We work with all our members towards our shared vision:</p>\r\n\r\n<blockquote>\r\n<p style="text-align: center;">"Together we can disrupt criminal payment fraud."</p>\r\n</blockquote>', 'Our Vision', '', 'inherit', 'open', 'open', '', '210-revision-v1', '', '', '2015-08-03 10:57:03', '2015-08-03 09:57:03', '', 210, 'http://localhost:8888/fits/210-revision-v1/', 0, 'revision', '', 0),
(280, 1, '2015-08-03 10:58:47', '2015-08-03 09:58:47', '<p style="text-align: center;">We are establishing a FITS advisory board to help steer all aspects of the strategic direction of FITS. The advisory board is to be made up of members, payment industry experts, key figures from the research community, law enforcement, regulators, other industry bodies and government.</p><br/>\r\n<p style="text-align: center;">Our Advisory Board is not yet another âthink tankâ but a group of individuals that share in our vision for reducing crime due to fraud and improving the security of all payments.Â  A quarterly, round-table Board meeting will be held and key topics discussed.</p><br/>\r\n<p style="text-align: center;">The Advisory Board will also oversee aspects of our governance to ensure an open and transparent operating environment.</p><br/>\r\n<p style="text-align: center;">If you are interested in joining the Advisory Board please contact our member services.</p>', 'The Advisory Board', '', 'inherit', 'open', 'open', '', '71-revision-v1', '', '', '2015-08-03 10:58:47', '2015-08-03 09:58:47', '', 71, 'http://localhost:8888/fits/71-revision-v1/', 0, 'revision', '', 0),
(281, 1, '2015-08-03 11:02:52', '2015-08-03 10:02:52', '&nbsp;\r\n\r\nMembership includes a licence to use our Fathom FMS software based on the Storm Rules Engine and the technology created by the Fraud &amp; Security Laboratory â designed from the ground up.\r\n<br/>\r\n\r\nFathom can ingest both real-time transactions (standard ISO messaging) and batch-based files at astonishing 4m+ events per second.\r\n<br/>\r\nIt has been designed so that it is straightforward to use, operates 24/7 and any changes can be made immediately.\r\n<br/>\r\nFathom is fully scalable from the smallest to the largest deployment and it supports acquirers, issuers, gateways, merchants and all participants in payment processing.\r\n<br/>\r\nIt has a beautifully designed browser based user interface, designed for ease of use with the minimum amount of information intelligently displayed.\r\n<br/>\r\nIt supports fully customised real-time dashboards that can be easily created and viewed by you.\r\n<br/>\r\nIt includes full system security, audit, and user access control. Our members determine the future roadmap of Fathomâs features and development a change from being told by a vendor.\r\n<br/>\r\nFathom is designed to work alongside existing fraud management software â providing valuable additional insight and increasing accuracy of detection while cutting false alarms.\r\n<br/>\r\nFathomâs case manager is designed for fast review and to collect information for law enforcement and prosecution as part of a chain-of-confidence approved by the courts.', 'Fathom - Fraud Management Software', '', 'inherit', 'open', 'open', '', '42-revision-v1', '', '', '2015-08-03 11:02:52', '2015-08-03 10:02:52', '', 42, 'http://localhost:8888/fits/42-revision-v1/', 0, 'revision', '', 0),
(282, 1, '2015-08-03 11:17:34', '2015-08-03 10:17:34', '<p>The MindsI Engine is an adaptive machine learning system available within Fathom. The MindsI Engine has been designed to learn from the billions of records that you are collecting every day and to provide you answers.<br/>\n\n<p>The MindsI Engine requires just one step to setup and it will never get out of date as starts learning straightaway â thatâs really important. No project is required, no batch learning, no weeks of time and resource and no paying vendors. It just starts doing its job as soon as soon as it is activated. The MindsI engine educes the need for expensive and time-consuming manual processes and the reliance on scarce analysts and experts.\n<h2>Making Decisions - 24x7, 365 days a year</h2>\n<p>The MindsI Engine will listen to your data quietly in the background, 24x7, 365 days a year; helping to automate fraud decisions. This allows your experts to focus on just those decisions where human knowledge is needed.<br/>\n\n<p>MindsI can be combined with our Storm Rules Engine to make fully automated decisions perhaps sending a text message or email to a customer. Of course all this happens in real-time.Â We think this is going to disrupt the way you think.\n<h2>Get the right answers - fast</h2>\n<p>The uptake and use of neural networks and machine learning has been hampered by their âblack boxâ nature; while they may give an answer we need to know why. All too often machine learning keeps the exact method of reaching a decision hidden and you are reliant on experts or consultants to set them up.\n\n<p>Using our patented technology (US 20110264612) knowledge is extracted from the MindsI Engine in the form of easy to understand English like rules. Understanding the underlying decision structure allows you to quickly determine Key Performance Indicators (KPI) in your business and because MindsI is always learning â you can see how these KPIâs are changing over time. We think that is amazing!\n<h2>Out with the old</h2>\n<p>In a typical machine learning system, you will have to undertake a project:\n<ol>\n	<li>Choose and collect data</li>\n	<li>Review and clean the data</li>\n	<li>Convert the data into a suitable format</li>\n	<li>Build models</li>\n	<li>Evaluate models</li>\n	<li>And finally deploy the chosen model.</li>\n</ol>\n<p>This process takes both time and expertise; how quickly will the fixed model get out of date?\n\n<p>The MindsI Engine requires just one step and will never get out of date:\n<h2>Setup and start</h2>\nThe MindsI Engine starts learning as soon as it is activated. The engine can process almost any type of input field:\n<ul>\n	<li>Continuous values â e.g. value of a transaction, time at address, age</li>\n	<li>Discreet values â e.g. product codes, transaction type, country codes, region codes</li>\n	<li>Dates and Times</li>\n	<li>Unstructured data â e.g. emails, documents, voice-to-text</li>\n</ul>\n<p>Just as the biological brain consists of a set of specialised structures for different types of inputs, such as vision, auditory, olfactory, so too does the MindsI Engine. Fields are automatically processed without fuss or time consuming human analysis.\n<h2>Knowledge</h2>\n<p>MindsI needs to have sufficient experience of your data before it becomes sufficiently confident to start making decisions. The more examples it sees the more confident it will become and the more accurate. It is not just the volume of data but also how rich it is. MindsI constantly reviews its data feeds to ensure there is sufficient âintrinsic dimensionalityâ to enable an accurate output. MindsI has been created to only make decisions based on a solid foundation of learning â donât ask MindsI to predict the outcome of a Formula 1 race based on just two examples or the price of Apple shares (AAPL) to within a fraction of cent in 90-days time (although we are working on this!).\n\n<p>We know that it is easy for models to make a decision â the trick is to maintain a high accuracy and reduce the number of incorrect decisions. These false-positives can clog automated fraud decision systems and can give them a bad reputation with their users and reviewers. A range of tools are provided to balance accuracy, false-positives (an âacceptâ when it should have been âreferâ) and false-negatives (a âdeclineâ when it should have been âacceptâ). Of course we do not expect you to work all this out â the MindsI Engine uses a novel Peareto Front Multi-Objective Evolutionary algorithm to sort it all out.</p>', 'The MindsI Engine', '', 'inherit', 'open', 'open', '', '127-autosave-v1', '', '', '2015-08-03 11:17:34', '2015-08-03 10:17:34', '', 127, 'http://localhost:8888/fits/127-autosave-v1/', 0, 'revision', '', 0),
