all, from physical cards to large-scale data breaches. It is by bringing the best minds, the best technology and working together that we will make a measurable impact on fraud.</p><br/>\r\n<p style="text-align: center;">FITS has been formed by a passionate team committed to this vision. We work with all our members towards our shared vision:</p>\r\n\r\n<blockquote>\r\n<p style="text-align: center;">"Together we can disrupt criminal payment fraud."</p>\r\n</blockquote>', 'Our Vision', '', 'inherit', 'open', 'open', '', '210-revision-v1', '', '', '2015-08-03 11:10:35', '2015-08-03 10:10:35', '', 210, 'http://localhost:8888/fits/210-revision-v1/', 0, 'revision', '', 0),
