els to make a decision â the trick is to maintain a high accuracy and reduce the number of incorrect decisions. These false-positives can clog automated fraud decision systems and can give them a bad reputation with their users and reviewers. A range of tools are provided to balance accuracy, false-positives (an âacceptâ when it should have been âreferâ) and false-negatives (a âdeclineâ when it should have been âacceptâ). Of course we do not expect you to work all this out â the MindsI Engine uses a novel Peareto Front Multi-Objective Evolutionary algorithm to sort it all out.', 'The MindsI Engine', '', 'inherit', 'open', 'open', '', '127-revision-v1', '', '', '2015-08-03 11:15:17', '2015-08-03 10:15:17', '', 127, 'http://localhost:8888/fits/127-revision-v1/', 0, 'revision', '', 0),
