(303, 1, '2015-08-03 11:24:06', '2015-08-03 10:24:06', '<p style="text-align: center;">We are establishing a FITS advisory board to help steer all aspects of the strategic direction of FITS. The advisory board is to be made up of members, payment industry experts, key figures from the research community, law enforcement, regulators, other industry bodies and government.</p><br/>\r\n<p style="text-align: center;">Our Advisory Board is not yet another âthink tankâ but a group of individuals that share in our vision for reducing crime due to fraud and improving the security of all payments.Â  A quarterly, round-table Board meeting will be held and key topics discussed.</p><br/>\r\n<p style="text-align: center;">The Advisory Board will also oversee aspects of our governance to ensure an open and transparent operating environment.</p><br/>\r\n<p style="text-align: center;">If you are interested in joining the Advisory Board please contact our member services.</p>\r\n\r\n<h2 style="text-align: center;">Please complete our contact form:</h2>\r\n<div class="col-md-6 col-md-offset-3">[contact-form-7 id="198" title="Membership Contact Form"]</div>', 'The Advisory Board', '', 'inherit', 'open', 'open', '', '71-revision-v1', '', '', '2015-08-03 11:24:06', '2015-08-03 10:24:06', '', 71, 'http://localhost:8888/fits/71-revision-v1/', 0, 'revision', '', 0),
(304, 1, '2015-08-03 11:30:51', '2015-08-03 10:30:51', '<h1 style="text-align: center;">Become a Member</h1>\r\n<p style="text-align: center;">Membership is only available to registered banking and financial industry businesses and to consultants and vendors working in the payments industry.</p>\r\n<p style="text-align: center;">To uphold the highest professional and security standards there is a membership application process and you will need to be sponsored by a current member or by a FITS team member. Membership will then be by invitation.</p><br/>\r\n<p style="text-align: center;">We are currently seeking the FITS-5 to be our cornerstone members. These members will help shape FITS into an industry leading body whose aims align with their objectives.</p>\r\n<p style="text-align: center;">We need Tier 1 businesses that take an active interest in cutting their fraud write-offs and operational costs and in reducing fraud crime.</p>\r\n<p style="text-align: center;">Our FITS-5 members have a range of additional benefits, including the option to take a stake in the FITS corporate entity as it is formed.</p>', 'Institute of Financial Innovation in Transactions & Security', '', 'inherit', 'open', 'open', '', '175-revision-v1', '', '', '2015-08-03 11:30:51', '2015-08-03 10:30:51', '', 175, 'http://localhost:8888/fits/175-revision-v1/', 0, 'revision', '', 0),
(305, 1, '2015-08-03 11:31:03', '2015-08-03 10:31:03', '<h1 style="text-align: center;">Become a Member</h1>\r\n<p style="text-align: center;">Membership is only available to registered banking and financial industry businesses and to consultants and vendors working in the payments industry.</p>\r\n<p style="text-align: center;">To uphold the highest professional and security standards there is a membership application process and you will need to be sponsored by a current member or by a FITS team member. Membership will then be by invitation.</p><br/>\r\n<p style="text-align: center;">We are currently seeking the FITS-5 to be our cornerstone members. These members will help shape FITS into an industry leading body whose aims align with their objectives.</p>\r\n<p style="text-align: center;">We need Tier 1 businesses that take an active interest in cutting their fraud write-offs and operational costs and in reducing fraud crime.</p><br/>\r\n<p style="text-align: center;">Our FITS-5 members have a range of additional benefits, including the option to take a stake in the FITS corporate entity as it is formed.</p>', 'Institute of Financial Innovation in Transactions & Security', '', 'inherit', 'open', 'open', '', '175-revision-v1', '', '', '2015-08-03 11:31:03', '2015-08-03 10:31:03', '', 175, 'http://localhost:8888/fits/175-revision-v1/', 0, 'revision', '', 0),
(306, 1, '2015-08-03 11:31:35', '2015-08-03 10:31:35', '<h1 style="text-align: center;">Become a Member</h1>\r\n<p style="text-align: center;">Membership is only available to registered banking and financial industry businesses and to consultants and vendors working in the payments industry.</p>\r\n<p style="text-align: center;">To uphold the highest professional and security standards there is a membership application process and you will need to be sponsored by a current member or by a FITS team member. Membership will then be by invitation.</p><br/>\r\n<p style="text-align: center;">We are currently seeking the FITS-5 to be our cornerstone members. These members will help shape FITS into an industry leading body whose aims align with their objectives.</p>\r\n<p style="text-align: center;">We need Tier 1 businesses that take an active interest in cutting their fraud write-offs and operational costs and in reducing fraud crime.</p><br/>\r\n<p style="text-align: center;">Our FITS-5 members have a range of additional benefits, including the option to take a stake in the FITS corporate entity as it is formed.</p><br/>', 'Institute of Financial Innovation in Transactions & Security', '', 'inherit', 'open', 'open', '', '175-revision-v1', '', '', '2015-08-03 11:31:35', '2015-08-03 10:31:35', '', 175, 'http://localhost:8888/fits/175-revision-v1/', 0, 'revision', '', 0),
(307, 1, '2015-08-03 11:33:13', '2015-08-03 10:33:13', '<p>The Institute of Financial Innovation in Transactions and Security is in its formation phase. We are currently creating the legal non-profit entity and governance structures.</p><br/>\r\n\r\n<p>We are looking for our cornerstone founder members â <em>the FITS-10</em>. Founder members will help shape FITS into an industry leading body whose aims align with their objectives. We need Tier 1 businesses that take an active interest in cutting their fraud write-offs and operational costs and in reducing fraud crime. We need their industry leading expertise to add to ours. It is vital that we all collaborate against a common enemy by increasing communication over fraud. We recognise that there are multiple stakeholders in the payment fraud lifecycle and want to collaborate and cooperate on creating and evaluating new financial technologies and approaches.</p><br/>\r\n\r\n<p>For our FITS-10 members we will extend the following additional included benefits:</p><br/>\r\n<ul>\r\n	<li>You have the option of investing in the ordinary shares of the FITS entity to support our not-for-profit aims and to share in our success. See document, âFITS â Investing in Cutting Crimeâ</li>\r\n	<li>The FITS-10 will drive the roadmap for the development of the Fathom fraud detection and analytics software. The development will include data interfaces to be compatible with members existing systems. We will also work with the membersâ chosen system integrator to deploy Fathom in their data centre.</li>\r\n	<li>Lifetime 10% discount on all FITS fees and items after the first year of membership.</li>\r\n	<li>Permanent seat on the Advisory Board.</li>\r\n	<li>FITS-10 closed workshop event held at the University of Surrey campus.</li>\r\n	<li>FITS experts will undertake a fraud benchmark using membersâ data in a secure, PCI compliant environment to provide a detailed independent fraud benchmarking report. This will position the membersâ fraud write-off, operational costs, effectiveness and a range of other measures with their peers.</li>\r\n</ul><br/>\r\n<small>This information is provisional. All products and services are subject to terms and conditions. FITS reserves the right to alter the benefits and services it offers at any time. All details are correct at time of going to press. Fathom is under development and makes use of licenced technology.</small>', 'FITS-10', '', 'publish', 'open', 'open', '', 'fits-10', '', '', '2015-08-03 11:35:01', '2015-08-03 10:35:01', '', 0, 'http://localhost:8888/fits/?page_id=307', 0, 'page', '', 0),
