mbersâ fraud write-off, operational costs, effectiveness and a range of other measures with their peers.</li>\r\n</ul><br/>\r\n<small>This information is provisional. All products and services are subject to terms and conditions. FITS reserves the right to alter the benefits and services it offers at any time. All details are correct at time of going to press. Fathom is under development and makes use of licenced technology.</small>', 'FITS-10', '', 'inherit', 'open', 'open', '', '307-revision-v1', '', '', '2015-08-03 11:35:01', '2015-08-03 10:35:01', '', 307, 'http://localhost:8888/fits/307-revision-v1/', 0, 'revision', '', 0),
