(312, 1, '2015-08-03 12:03:14', '2015-08-03 11:03:14', '<p>The MindsI Engine is an adaptive machine learning system available within Fathom. The MindsI Engine has been designed to learn from the billions of records that you are collecting every day and to provide you answers.</p>\r\n\r\n<p>The MindsI Engine requires just one step to setup and it will never get out of date as starts learning straightaway â thatâs really important. No project is required, no batch learning, no weeks of time and resource and no paying vendors. It just starts doing its job as soon as soon as it is activated. The MindsI engine educes the need for expensive and time-consuming manual processes and the reliance on scarce analysts and experts.</p>\r\n<h2>Making Decisions - 24x7, 365 days a year</h2>\r\n<p>The MindsI Engine will listen to your data quietly in the background, 24x7, 365 days a year; helping to automate fraud decisions. This allows your experts to focus on just those decisions where human knowledge is needed.</p>\r\n\r\n<p>MindsI can be combined with our Storm Rules Engine to make fully automated decisions perhaps sending a text message or email to a customer. Of course all this happens in real-time.Â We think this is going to disrupt the way you think.</p>\r\n<h2>Get the right answers - fast</h2>\r\n<p>The uptake and use of neural networks and machine learning has been hampered by their âblack boxâ nature; while they may give an answer we need to know why. All too often machine learning keeps the exact method of reaching a decision hidden and you are reliant on experts or consultants to set them up.</p>\r\n\r\n<p>Using our patented technology (US 20110264612) knowledge is extracted from the MindsI Engine in the form of easy to understand English like rules. Understanding the underlying decision structure allows you to quickly determine Key Performance Indicators (KPI) in your business and because MindsI is always learning â you can see how these KPIâs are changing over time. We think that is amazing!</p>\r\n<h2>Out with the old</h2>\r\n<p>In a typical machine learning system, you will have to undertake a project:</p>\r\n<ol>\r\n	<li>Choose and collect data</li>\r\n	<li>Review and clean the data</li>\r\n	<li>Convert the data into a suitable format</li>\r\n	<li>Build models</li>\r\n	<li>Evaluate models</li>\r\n	<li>And finally deploy the chosen model.</li>\r\n</ol>\r\n<p>This process takes both time and expertise; how quickly will the fixed model get out of date? The MindsI Engine requires just one step and will never get out of date:\r\n<h2>Setup and start</h2>\r\nThe MindsI Engine starts learning as soon as it is activated. The engine can process almost any type of input field:\r\n<ul>\r\n	<li>Continuous values â e.g. value of a transaction, time at address, age</li>\r\n	<li>Discreet values â e.g. product codes, transaction type, country codes, region codes</li>\r\n	<li>Dates and Times</li>\r\n	<li>Unstructured data â e.g. emails, documents, voice-to-text</li>\r\n</ul>\r\n<p>Just as the biological brain consists of a set of specialised structures for different types of inputs, such as vision, auditory, olfactory, so too does the MindsI Engine. Fields are automatically processed without fuss or time consuming human analysis.</p>\r\n<h2>Knowledge</h2>\r\n<p>MindsI needs to have sufficient experience of your data before it becomes sufficiently confident to start making decisions. The more examples it sees the more confident it will become and the more accurate. It is not just the volume of data but also how rich it is. MindsI constantly reviews its data feeds to ensure there is sufficient âintrinsic dimensionalityâ to enable an accurate output. MindsI has been created to only make decisions based on a solid foundation of learning â donât ask MindsI to predict the outcome of a Formula 1 race based on just two examples or the price of Apple shares (AAPL) to within a fraction of cent in 90-days time (although we are working on this!).</p>\r\n\r\n<p>We know that it is easy for models to make a decision â the trick is to maintain a high accuracy and reduce the number of incorrect decisions. These false-positives can clog automated fraud decision systems and can give them a bad reputation with their users and reviewers. A range of tools are provided to balance accuracy, false-positives (an âacceptâ when it should have been âreferâ) and false-negatives (a âdeclineâ when it should have been âacceptâ). Of course we do not expect you to work all this out â the MindsI Engine uses a novel Peareto Front Multi-Objective Evolutionary algorithm to sort it all out.</p>', 'The MindsI Engine', '', 'inherit', 'open', 'open', '', '127-revision-v1', '', '', '2015-08-03 12:03:14', '2015-08-03 11:03:14', '', 127, 'http://localhost:8888/fits/127-revision-v1/', 0, 'revision', '', 0),
(313, 1, '2015-08-03 12:03:58', '2015-08-03 11:03:58', '&nbsp;\r\n\r\nMembership includes a licence to use our Fathom FMS software based on the Storm Rules Engine and the technology created by the Fraud &amp; Security Laboratory â designed from the ground up.\r\n\r\nFathom can ingest both real-time transactions (standard ISO messaging) and batch-based files at astonishing 4m+ events per second.\r\n\r\nIt has been designed so that it is straightforward to use, operates 24/7 and any changes can be made immediately.\r\n\r\nFathom is fully scalable from the smallest to the largest deployment and it supports acquirers, issuers, gateways, merchants and all participants in payment processing.\r\n\r\nIt has a beautifully designed browser based user interface, designed for ease of use with the minimum amount of information intelligently displayed.\r\n\r\nIt supports fully customised real-time dashboards that can be easily created and viewed by you.\r\n\r\nIt includes full system security, audit, and user access control. Our members determine the future roadmap of Fathomâs features and development a change from being told by a vendor.\r\n\r\nFathom is designed to work alongside existing fraud management software â providing valuable additional insight and increasing accuracy of detection while cutting false alarms.\r\n\r\nFathomâs case manager is designed for fast review and to collect information for law enforcement and prosecution as part of a chain-of-confidence approved by the courts.', 'Fathom - Fraud Management Software', '', 'inherit', 'open', 'open', '', '42-revision-v1', '', '', '2015-08-03 12:03:58', '2015-08-03 11:03:58', '', 42, 'http://localhost:8888/fits/42-revision-v1/', 0, 'revision', '', 0);
