(373, 1, '2015-08-06 21:40:14', '2015-08-06 20:40:14', '<p style="text-align: center;">Did you know that every $1 in $100 of all crime proceeds in the world comes from payment card fraud according to the United Nations?</p>\r\n<p style="text-align: center;">Each $1 of fraud may help towards funding terrorist networks like the al-Qaeda for bombs and arms as well as organised crime gangs and illicit drugs.</p>\r\n<blockquote>\r\n<p style="text-align: center;">Thatâs a potential $16,000,000,000 of funding to criminals in 2015.</p>\r\n</blockquote>\r\n<p style="text-align: center;">If this was a single company it would be in the top 250 of all global companies and its shareholders would be happy at the 15% annual growth. But we are not happy.Â We want to stop this money going to criminals. We want to fight to dramatically cut fraud, reversing the growth and we want to do this with you.Â Fighting payment fraud is hard and expensive but it doesnât have to be. We are committed to a visionary program of research that also delivers what is needed right now.<br/>Â The Institute<sup>[tbc]</sup> for Financial Innovation in Transactions and Security (FITS) is an independent non-profit organisation with this simple vision: together we can disrupt criminals.</p>\r\n<p style="text-align: center;">As a member of FITS you will have access to an extensive range of benefits included in your annual member fees.Â This includes Fathom a powerful AI driven real-time fraud management system built on a big data engine with interactive analytics available on a secure private cloud or deployed in your data-centre.Â Created for all our members; generating knowledge on evolving fraud types through the latest Data Analytics breakthroughs.</p>\r\n<p style="text-align: center;">Having spent the last 25 years building innovative systems to spot fraud, one thing is strikingly obvious, the fraudsters and hackers donât care who they attack: cardholders, banks, issuers, acquirers, gateways, payment processors, merchants, big or small, from physical cards to large-scale data breaches. It is by bringing the best minds, the best technology and working together that we will make a measurable impact on fraud.</p>\r\n<p style="text-align: center;">FITS has been formed by a passionate team committed to this vision. We work with all our members towards our shared vision:</p>\r\n<blockquote>\r\n<p style="text-align: center;">"Together we can disrupt criminal payment fraud."</p>\r\n</blockquote>', 'Our Vision', '', 'inherit', 'open', 'open', '', '210-revision-v1', '', '', '2015-08-06 21:40:14', '2015-08-06 20:40:14', '', 210, 'http://localhost:8888/fits/?p=373', 0, 'revision', '', 0),
(374, 1, '2015-08-06 21:41:31', '2015-08-06 20:41:31', '<p style="text-align: center;">Our core membership is by invitation only for organisations and is available to G20 countries to registered banks,<br/>acquirers, issuers, payment gateways, large merchants and regulatedÂ financial industry businesses.</p>\r\n<p style="text-align: center;">If you wish to accept our invitation to become a FITS member to start disrupting fraud<br/>thenÂ please contact us to discuss your application and membership fees.</p>\r\n\r\n<h2 style="text-align: center;">Please complete our contact form:</h2>\r\n<div class="col-md-6 col-md-offset-3">[contact-form-7 id="198" title="Membership Contact Form"]</div>', 'Become a Member', '', 'inherit', 'open', 'open', '', '91-revision-v1', '', '', '2015-08-06 21:41:31', '2015-08-06 20:41:31', '', 91, 'http://localhost:8888/fits/?p=374', 0, 'revision', '', 0),
