(380, 1, '2015-08-25 11:29:11', '2015-08-25 10:29:11', 'A rules-based decision engine is a key component to help to automate important business decisions. The Storm Rules Engine is integrated into FraXses so that the power of self-service configurable data sources (real-time or batch) is immediately leveraged.\n<h3>Amazing Configuration of Data Sources</h3>\nWe know that the future is going to change. We know that your business is going to change and we know that whatever happens you are going to be faced with more data and more data sources.\n\nOur customers told us they were fed up with vendor CCN (Contract Change Notice) or SOW (Statement of Work) and their cost and delays. So we have fixed that: If you want to add a new data field, change a type or even add a completely new database or live feed it is just a few clicks away; there are no âconsultantsâ required. Changes can be made in minutes and go live as soon as a click.\n<h2>Why Rules?</h2>\nRules are at the hub of automating business decisions:\n<ul>\n	<li>Accept/Decline or refer this transaction</li>\n	<li>Accept this new customer</li>\n	<li>Accept or refer this insurance claim</li>\n	<li>Accept or reject this customer for a personal loan</li>\n	<li>Has this customer stopped using us â Send them an email message or SMS</li>\n	<li>Send a special offer to this customer</li>\n	<li>Can I recover this bad debt?</li>\n</ul>\n<h2>Dynamic Rules</h2>\nIntenda does rules differently from what you may have seen before. Firstly, the Storm engine is designed for real-time decisions. It is fast. Really fast, processing over 6,500 transactions a second for a set of 150 rules; thatâs a decision every 150 micro seconds<sup>[1]</sup>! Of course the rules can be updated, changed, temporarily suspended dynamically â subject to user privileged and an optional two-staged authorisation process.\n\nThe Storm Rules Engine is not just fast, it supports sophisticated rule types designed by talking to our business customers to make them easy to understand and configure.\n<h2>Sophisticated</h2>\n<ul>\n	<li>Any input field from any data source can be used in a rule â this could be a field from a real-time ISO 8583 message feed, a date from a batch loaded customer file, a flag from your CRM system, values from the MindsI Neural Engine, or even a value from another rule or set of rules.</li>\n	<li>The fields can be used in expressions that can include other fields, values, percentages, user defined lists.</li>\n	<li>New fields can be specified using statistical functions capturing information over a period of time, e.g. average over last 90 days, number of transactions in last hour, etc. This fields are calculated in real-time â even over a billion records (remember this is FraXses).</li>\n	<li>You can compare fields using a range of operators, including fuzzy matching of text fields.</li>\n	<li>You can combine statements together in any way you wish to build up a single complex rule or you can group together rules.</li>\n	<li>When a rule is âbrokenâ (evaluated to âyesâ) it can generate an output. This can be a single YES/NO type flag, a message response code or any user defined value. Rules can be set to produce a user set numeric score that is then added up over a whole rule set.</li>\n	<li>Rules or sets of rules can be easily configured to operate over a specific time or date period.</li>\n	<li>We know that the outside world changes â perhaps a seasonal holiday or a big sporting event? The parameters in your rules can be adjusted (multiplied by a percentage, or adding a value, or replacing a value) according to a set of user defined values. These can then be specified to activate over a specific period, either calendar based or relative to today. This allows the same rules to encompass long-term or short-term changing trends. Changes can take effect immediately across specified rules or rule sets and can even be set to apply based on another rule.</li>\n</ul>\n<h2>Sandbox</h2>\nOf course we know that you will want to experiment with your rules. We have created a sandbox for the Storm Rules Engine. Here you can create new rules, edit old ones and immediately see the impact. The sandbox runs the rules over previous data to produce statistics on rule and rule set performance:\n<ul>\n	<li>Number of breaks of a single rule over a time period</li>\n	<li>Calculate false-positives (the number of times a rule breaks when it was not supposed to)</li>\n	<li>Calculate number of alerts per hour/day/etc. Graph of this over a 24 hour period.</li>\n	<li>Any analytics that fraPses can perform</li>\n</ul>\nAgain, this is all fast. So fast that the results will be there on the screen as you make the changes to the rules.\n\n<sup>[1]</sup Under test conditions, single Intel i7 2.6Ghz processor, mixed complexity rules.', 'Storm Rules Engine', '', 'inherit', 'closed', 'closed', '', '262-autosave-v1', '', '', '2015-08-25 11:29:11', '2015-08-25 10:29:11', '', 262, 'http://localhost:8888/fits/262-autosave-v1/', 0, 'revision', '', 0),
(381, 1, '2015-08-25 11:29:26', '2015-08-25 10:29:26', 'A rules-based decision engine is a key component to help to automate important business decisions. The Storm Rules Engine is integrated into FraXses so that the power of self-service configurable data sources (real-time or batch) is immediately leveraged.\r\n<h3>Amazing Configuration of Data Sources</h3>\r\nWe know that the future is going to change. We know that your business is going to change and we know that whatever happens you are going to be faced with more data and more data sources.\r\n\r\nOur customers told us they were fed up with vendor CCN (Contract Change Notice) or SOW (Statement of Work) and their cost and delays. So we have fixed that: If you want to add a new data field, change a type or even add a completely new database or live feed it is just a few clicks away; there are no âconsultantsâ required. Changes can be made in minutes and go live as soon as a click.\r\n<h2>Why Rules?</h2>\r\nRules are at the hub of automating business decisions:\r\n<ul>\r\n	<li>Accept/Decline or refer this transaction</li>\r\n	<li>Accept this new customer</li>\r\n	<li>Accept or refer this insurance claim</li>\r\n	<li>Accept or reject this customer for a personal loan</li>\r\n	<li>Has this customer stopped using us â Send them an email message or SMS</li>\r\n	<li>Send a special offer to this customer</li>\r\n	<li>Can I recover this bad debt?</li>\r\n</ul>\r\n<h2>Dynamic Rules</h2>\r\nIntenda does rules differently from what you may have seen before. Firstly, the Storm engine is designed for real-time decisions. It is fast. Really fast, processing over 6,500 transactions a second for a set of 150 rules; thatâs a decision every 150 micro seconds<sup>[1]</sup>! Of course the rules can be updated, changed, temporarily suspended dynamically â subject to user privileged and an optional two-staged authorisation process.\r\n\r\nThe Storm Rules Engine is not just fast, it supports sophisticated rule types designed by talking to our business customers to make them easy to understand and configure.\r\n<h2>Sophisticated</h2>\r\n<ul>\r\n	<li>Any input field from any data source can be used in a rule â this could be a field from a real-time ISO 8583 message feed, a date from a batch loaded customer file, a flag from your CRM system, values from the MindsI Neural Engine, or even a value from another rule or set of rules.</li>\r\n	<li>The fields can be used in expressions that can include other fields, values, percentages, user defined lists.</li>\r\n	<li>New fields can be specified using statistical functions capturing information over a period of time, e.g. average over last 90 days, number of transactions in last hour, etc. This fields are calculated in real-time â even over a billion records (remember this is FraXses).</li>\r\n	<li>You can compare fields using a range of operators, including fuzzy matching of text fields.</li>\r\n	<li>You can combine statements together in any way you wish to build up a single complex rule or you can group together rules.</li>\r\n	<li>When a rule is âbrokenâ (evaluated to âyesâ) it can generate an output. This can be a single YES/NO type flag, a message response code or any user defined value. Rules can be set to produce a user set numeric score that is then added up over a whole rule set.</li>\r\n	<li>Rules or sets of rules can be easily configured to operate over a specific time or date period.</li>\r\n	<li>We know that the outside world changes â perhaps a seasonal holiday or a big sporting event? The parameters in your rules can be adjusted (multiplied by a percentage, or adding a value, or replacing a value) according to a set of user defined values. These can then be specified to activate over a specific period, either calendar based or relative to today. This allows the same rules to encompass long-term or short-term changing trends. Changes can take effect immediately across specified rules or rule sets and can even be set to apply based on another rule.</li>\r\n</ul>\r\n<h2>Sandbox</h2>\r\nOf course we know that you will want to experiment with your rules. We have created a sandbox for the Storm Rules Engine. Here you can create new rules, edit old ones and immediately see the impact. The sandbox runs the rules over previous data to produce statistics on rule and rule set performance:\r\n<ul>\r\n	<li>Number of breaks of a single rule over a time period</li>\r\n	<li>Calculate false-positives (the number of times a rule breaks when it was not supposed to)</li>\r\n	<li>Calculate number of alerts per hour/day/etc. Graph of this over a 24 hour period.</li>\r\n	<li>Any analytics that fraPses can perform</li>\r\n</ul>\r\nAgain, this is all fast. So fast that the results will be there on the screen as you make the changes to the rules.\r\n\r\n<sup>[1]</sup>Under test conditions, single Intel i7 2.6Ghz processor, mixed complexity rules.', 'Storm Rules Engine', '', 'inherit', 'closed', 'closed', '', '262-revision-v1', '', '', '2015-08-25 11:29:26', '2015-08-25 10:29:26', '', 262, 'http://localhost:8888/fits/262-revision-v1/', 0, 'revision', '', 0),
