 to apply based on another rule.</li>\r\n</ul>\r\n<h2>Sandbox</h2>\r\nOf course we know that you will want to experiment with your rules. We have created a sandbox for the Storm Rules Engine. Here you can create new rules, edit old ones and immediately see the impact. The sandbox runs the rules over previous data to produce statistics on rule and rule set performance:\r\n<ul>\r\n	<li>Number of breaks of a single rule over a time period</li>\r\n	<li>Calculate false-positives (the number of times a rule breaks when it was not supposed to)</li>\r\n	<li>Calculate number of alerts per hour/day/etc. Graph of this over a 24 hour period.</li>\r\n	<li>Any analytics that fraPses can perform</li>\r\n</ul>\r\nAgain, this is all fast. So fast that the results will be there on the screen as you make the changes to the rules.\r\n\r\n<sup>[1]</sup><small>Under test conditions, single Intel i7 2.6Ghz processor, mixed complexity rules.</small>', 'Storm Rules Engine', '', 'inherit', 'closed', 'closed', '', '262-revision-v1', '', '', '2015-08-25 11:50:01', '2015-08-25 10:50:01', '', 262, 'http://localhost:8888/fits/262-revision-v1/', 0, 'revision', '', 0),
(383, 1, '2015-08-25 12:09:39', '2015-08-25 11:09:39', '<div class="table table-responsive ">\n<table class="table">\n<tr>\n<td width="41">â</td>\n<td width="655">To focus on the participants and processes in the cashless payments sector</td>\n</tr>\n<tr>\n<td width="41">â</td>\n<td width="655">To measurably reduce the value of fraud write-offs from cashless payments for our members.</td>\n</tr>\n<tr>\n<td width="41">â</td>\n<td width="655">To reduce the operational costs of the cashless payments fraud lifecycle by at least 50% for our members.</td>\n</tr>\n<tr>\n<td width="41">â</td>\n<td width="655">To dramatically cut the funding from cashless payment fraud into to criminal enterprise.</td>\n</tr>\n<tr>\n<td width="41">â</td>\n<td width="655">To undertake a focused programme of research into novel techniques and technology to have a substantial impact on current fraud approaches that is published and made available to all members.</td>\n</tr>\n<tr>\n<td width="41">â</td>\n<td width="655">To provide state of the art software fraud management platform to all members that can be deployed locally or in the FITS data cloud.</td>\n</tr>\n<tr>\n<td width="41">â</td>\n<td width="655">To provide a PCI approved, point-to-point secure cloud environment to enable high-level fraud analytics and data collaboration.</td>\n</tr>\n<tr>\n<td width="41">â</td>\n<td width="655">To collaborate and promote a co-operative environment with our members and all participants in payment processing.</td>\n</tr>\n<tr>\n<td width="41">â</td>\n<td width="655">To build and share knowledge in a secure environment and to provide a discussion forum for our members.</td>\n</tr>\n<tr>\n<td width="41">â</td>\n<td width="655">To form strategic alliances with industry, government and law enforcement bodies.</td>\n</tr>\n<tr>\n<td width="41">â</td>\n<td width="655">To establish working relationships with fraud forums worldwide.</td>\n</tr>\n<tr>\n<td width="41">â</td>\n<td width="655">To encourage payment processors worldwide to seek membership.</td>\n</tr>\n<tr>\n<td width="41">â</td>\n<td width="655">To promote high standards of ethics, excellence and professionalism throughout the payments industry and to represent the interests of our members to the wider business community and government.</td>\n</tr>\n<tr>\n<td width="41">â</td>\n<td width="655">To identify fraud risks, emerging fraud types and approaches for mitigation and to publish, disseminate or otherwise make available the results of such study or research.</td>\n</tr>\n<tr>\n<td width="41">â</td>\n<td width="655">To publically raise awareness of tools and methods to enable the payments industry to manage fraud more effectively.</td>\n</tr>\n</tbody>\n</table>\n<p style="text-align: center;"><small>This information is provisional. All products and services are subject to terms and conditions. FITS reserves the right to alter the benefits and services it offers at any time. All details are correct at time of going to press. Fathom is under development and makes use of licenced technology.</small></p>', 'Membership Aims', '', 'inherit', 'closed', 'closed', '', '273-autosave-v1', '', '', '2015-08-25 12:09:39', '2015-08-25 11:09:39', '', 273, 'http://localhost:8888/fits/273-autosave-v1/', 0, 'revision', '', 0),
