secure environment and to provide a discussion forum for our members.</td>\r\n</tr>\r\n<tr>\r\n<td style="width:60px;text-align:center;color:#AE9B80;">â</td>\r\n<td>To form strategic alliances with industry, government and law enforcement bodies.</td>\r\n</tr>\r\n<tr>\r\n<td style="width:60px;text-align:center;color:#AE9B80;">â</td>\r\n<td>To establish working relationships with fraud forums worldwide.</td>\r\n</tr>\r\n<tr>\r\n<td style="width:60px;text-align:center;color:#AE9B80;">â</td>\r\n<td>To encourage payment processors worldwide to seek membership.</td>\r\n</tr>\r\n<tr>\r\n<td style="width:60px;text-align:center;color:#AE9B80;">â</td>\r\n<td>To promote high standards of ethics, excellence and professionalism throughout the payments industry and to represent the interests of our members to the wider business community and government.</td>\r\n</tr>\r\n<tr>\r\n<td style="width:60px;text-align:center;color:#AE9B80;">â</td>\r\n<td>To identify fraud risks, emerging fraud types and approaches for mitigation and to publish, disseminate or otherwise make available the results of such study or research.</td>\r\n</tr>\r\n<tr>\r\n<td style="width:60px;text-align:center;color:#AE9B80;">â</td>\r\n<td>To publically raise awareness of tools and methods to enable the payments industry to manage fraud more effectively.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style="text-align: center;"><small>This information is provisional. All products and services are subject to terms and conditions. FITS reserves the right to alter the benefits and services it offers at any time. All details are correct at time of going to press. Fathom is under development and makes use of licenced technology.</small></p>', 'Membership Aims', '', 'inherit', 'closed', 'closed', '', '273-revision-v1', '', '', '2015-08-25 12:26:56', '2015-08-25 11:26:56', '', 273, 'http://localhost:8888/fits/273-revision-v1/', 0, 'revision', '', 0),
(396, 1, '2015-08-25 12:28:10', '2015-08-25 11:28:10', '<div class="table">\r\n<table class="table table-responsive table-hover">\r\n<thead>\r\n<tr>\r\n<td>\r\n<h4><strong>Member Benefit</strong></h4>\r\n</td>\r\n<td>\r\n<h4><strong>Description</strong></h4>\r\n</td>\r\n</tr>\r\n</thead>\r\n<tbody class="table-hover">\r\n<tr>\r\n<td class="table-heading">\r\n<h4><strong>Fathom Software Licence</strong></h4>\r\n</td>\r\n<td>This is a licence for the use the Fathom Fraud Management Software (acquirers, issuers, PSP) software deployed within a membersâ datacentre for unlimited users/servers in a single country. The licence remains valid during active membership and upon cessation Fathom software may be used for six-months without updates/support.</td>\r\n</tr>\r\n<tr>\r\n<td class="table-heading">\r\n<h4><strong>Roadmap Priority</strong></h4>\r\n</td>\r\n<td>As Fathom is developed and functionality is incrementally delivered, members can request specific features as a priority in the product roadmap. These features will be provided as soon as practical.</td>\r\n</tr>\r\n<tr>\r\n<td class="table-heading">\r\n<h4><strong>Basic Support SLA</strong></h4>\r\n</td>\r\n<td>An on-line and telephone support service for all FITS provided services based on the FITS basic SLA (working hours - 08:00 am - 17:00 pm UK time Mon-Fri except Bank Holidays).</td>\r\n</tr>\r\n<tr>\r\n<td class="table-heading">\r\n<h4><strong>Private Cloud</strong></h4>\r\n</td>\r\n<td>Criminals are agnostic as to where they undertake the fraud. Fathom has a unique neural âdatagram profiling systemâ which is securely shared through an encrypted private cloud with all Fathom installations so that all members benefit from the recognition of emerging fraud types. The private cloud is highly secure and resilient at a PCI Compliant, ISO 27001 certified data centre, accredited to IL3/IL4, ISO 9001 and 14001 certified, PGA accredited and official classified services using encrypted PSN overlay accredited.</td>\r\n</tr>\r\n<tr>\r\n<td class="table-heading">\r\n<h4><strong>Horizon Scan</strong></h4>\r\n</td>\r\n<td>As part of our research programme, the Horizon Scan service is being created that will alert members of latest data breaches and new types of threats as they discovered. It is designed as a further input to the Fathom software.</td>\r\n</tr>\r\n<tr>\r\n<td class="table-heading">\r\n<h4><strong>âInsightsâ Magazine</strong></h4>\r\n</td>\r\n<td>Quarterly report and newsletter based on advanced analytical analysis of fraud behaviours and patterns both in general and detail along with advice, rules and methods to prevent or detect payment fraud.</td>\r\n</tr>\r\n<tr>\r\n<td class="table-heading">\r\n<h4><strong>Share Purchase</strong></h4>\r\n</td>\r\n<td>FITS-10 membership gives the option for the investment in a limited number of Ordinary shares in the FITS legal entity. Â  Share in our success.</td>\r\n</tr>\r\n<tr>\r\n<td class="table-heading">\r\n<h4><strong>Supplier Catalogue</strong></h4>\r\n</td>\r\n<td>An independent catalogue of vendors, partners, consultants and services available in payments security and cybercrime prepared by the FITS team.</td>\r\n</tr>\r\n<tr>\r\n<td class="table-heading">\r\n<h4><strong>Best Practice Guidelines</strong></h4>\r\n</td>\r\n<td>A printed book of practical best practice guidelines in the implementation of prevention measures and in the detection of fraud. Including the full customer lifecycle from application to collections using what is commercially available today as elements of an overall solution.</td>\r\n</tr>\r\n<tr>\r\n<td class="table-heading">\r\n<h4><strong>Fraud laboratory</strong></h4>\r\n</td>\r\n<td>Fast access to the latest research outputs from academia and aligned research bodies including peer-reviewed journal papers, obfuscated datasets and detailed results.</td>\r\n</tr>\r\n<tr>\r\n<td class="table-heading">\r\n<h4><strong>Open Source Library </strong></h4>\r\n</td>\r\n<td>Code written and developed at FITS based on the Fraud Laboratory research will be provided to work with R and other APIs and will be made available as open source with licence to the Vendor Club members to encourage their use and integration into third party solutions.</td>\r\n</tr>\r\n<tr>\r\n<td class="table-heading">\r\n<h4><strong>Intellectual Property (IP) Portfolio</strong></h4>\r\n</td>\r\n<td>FITS in collaboration with the University of Surrey will protect IP through patents and design registration. Members will enjoy complete access to all such IP.</td>\r\n</tr>\r\n<tr>\r\n<td class="table-heading">\r\n<h4><strong>Annual Conference</strong></h4>\r\n</td>\r\n<td>Invite only, annual conference open to members and the Vendor Club with invited government, law enforcement and payment expert speakers.</td>\r\n</tr>\r\n<tr>\r\n<td class="table-heading">\r\n<h4><strong>Member Login</strong></h4>\r\n</td>\r\n<td>Members will be able to log into a secure area of our website to access exclusive content.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<!-- /.responsive table -->', 'Member Benefits', '', 'inherit', 'closed', 'closed', '', '73-revision-v1', '', '', '2015-08-25 12:28:10', '2015-08-25 11:28:10', '', 73, 'http://localhost:8888/fits/73-revision-v1/', 0, 'revision', '', 0);
